import React, { Component } from "react";
import symboldefs from "./css/symbol-defs.svg";
import "./css/icon.css";

const icons = {
  HTML: { icon: "html5" },
  "React.js": { icon: "react" },
  CSS: { icon: "css3" },
  JS: { icon: "javascript" },
  "ASP.NET": { icon: "dot-net" },
  Python: { icon: "python" },
  "Raspberry Pi": { icon: "raspberrpi" },
  Photoshop: { icon: "adobephotoshop" },
  "Google Chrome Extensions": { icon: "chrome" }
};

export default class icon extends Component {
  getType(type) {}
  render() {
    const { icon, displayType } = this.props;
    var displayIcon, displayText;
    switch (displayType) {
      case "":
        displayIcon = true;
        displayText = true;
      case "icon":
        displayIcon = true;
        displayText = false;
      case "text":
        displayIcon = false;
        displayText = true;
    }

    function renderIcon() {
      return (
        <i className="icon">
          <svg xmlns="http://www.w3.org/2000/svg" width="20" height="20">
            <use xlinkHref={`${symboldefs}#${"icon-" + icons[icon].icon}`} />
          </svg>
        </i>
      );
    }

    function renderText() {
      return <span>{icon}</span>;
    }
  }
}
